import React, {useState, useContext, useEffect} from "react";
import { ProductList } from './components/AppStyles';
function PensA(){
    return(
        <div>
        <ProductList>
          {context.products.map((p) => (
            <Product key={p.id}
             id={p.id}
             imageURL={p.imageURL}
             price = {p.price}
             title={p.title}
             addProductToCart={context.addProductToCart}
            />
          ))}
        </ProductList>
      </div>

    )
};

export default PensA;
